webpackJsonp([99794875316057],{429:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Laura Domine",subtitle:"Postdoc",copyright:"Powered by Gatsby. © All rights reserved.",menu:[{label:"About",path:"/"},{label:"Research",path:"/research"},{label:"Projects",path:"/projects"},{label:"Blog",path:"/blog"},{label:"Contact",path:"/contact/"}],author:{name:"Laura Domine",email:"laura.domine@cfa.harvard.edu",telegram:"#",twitter:"#",github:"Temigo",rss:"#",vk:"#",linkedin:"laura-dominé-017242106"}}},markdownRemark:{id:"/home/temigo/Temigo.github.io/src/pages/pages/2018-07-01---research/index.md absPath of file >>> MarkdownRemark",html:'<h3>Current research</h3>\n<p>Credible witnesses report unidentified aerial phenomena (UAP) that have properties and kinematics purportedly outside the performance envelope of known phenomena.\nWhether a new rare atmospheric phenomenon or evidence of an extrasolar technosignature, we simply lack the scientific data that is required to elucidate the nature of Unidentified Aerial Phenomena (UAP), owing to historical stigma and the dearth of dedicated experimental studies.\nNASA highlighted in 2023 in an independent study the need for “purpose-built future sensors for UAP detection” and “multisensor platforms … for providing a complete picture of a UAP event”.\nInstrumentation-based UAP investigations collect vast amounts of data: they require machine learning models to detect, classify and identify all natural and man-made objects, using multiple modalities, before searching for any potentially novel class of objects.\nI am interested in building a multimodal foundation model for generalized class discovery that  can be distilled to other smaller multisensor platforms.</p>\n<h3>Past research</h3>\n<p>I worked in the <a href="https://sites.slac.stanford.edu/neutrino/">Neutrino Group</a> at SLAC National Accelerator Laboratory under the supervision of <a href="http://www.codingkazu.com">Kazuhiro Terao</a> and <a href="https://profiles.stanford.edu/hirohisa-tanaka">Hirohisa Tanaka</a>. My main focus was on deep learning applications to data reconstruction and analysis of neutrino detectors based on liquid argon time projection chambers (LArTPC), such as <a href="https://icarus.fnal.gov/">ICARUS</a>.\nYou can read about my <a href="/neutrino">PhD research on ML for neutrino detectors</a> and <a href="/projects">other projects</a>.</p>\n<h3>Publications</h3>\n<p>L. Dominé, Biswas A., Cloete R., Delacroix A., Fedorenko A., Jacaruso L., Kelderman E., Keto E., Little S., Loeb A., Masson E., Prior\nM., Schultz F., Szenher M., Watters W., White A. (2025) <a href="https://www.mdpi.com/1424-8220/25/3/783">Commissioning An All-Sky Infrared Camera Array for Detection Of Airborne\nObjects</a> <em>Sensors 25(3), 783</em></p>\n<p>L. Dominé, P. Côte de Soux, F. Drielsma, D. H. Koh, R. Itay, Q. Lin, K. Terao, K. V. Tsang, and T. L. Usher (on behalf of the DeepLearn-\nPhysics Collaboration) (2021) <a href="https://journals.aps.org/prd/abstract/10.1103/PhysRevD.104.032004">Point Proposal Network for Reconstructing 3D Particle Positions with Sub-Pixel Precision in Liquid\nArgon Time Projection Chambers</a> <em>Physical Review D 104, 032004</em></p>\n<p>F. Drielsma, Q. Lin, P. Côte de Soux, L. Dominé, R. Itay, D. H. Koh, B. J. Nelson, K. Terao, K. V. Tsang, and T. L. Usher (DeepLearnPhysics\nCollaboration) (2021) <a href="https://journals.aps.org/prd/abstract/10.1103/PhysRevD.104.072004">Clustering of Electromagnetic Showers and Particle Interactions with Graph Neural Networks in Liquid Argon\nTime Projection Chambers Data</a> <em>Physical Review D 104, 072004</em></p>\n<p>F. Drielsma, K. Terao, L. Dominé, D. H. Koh (2020) <a href="https://ml4physicalsciences.github.io/2020/files/NeurIPS_ML4PS_2020_149.pdf">Scalable, End-to-End, Deep-Learning-Based Data Reconstruction Chain for\nParticle Imaging Detectors</a> <em>Third Workshop on Machine Learning and the Physical Sciences (NeurIPS 2020)</em></p>\n<p>L. Dominé, K. Terao (2020) <a href="https://journals.aps.org/prd/abstract/10.1103/PhysRevD.102.012005">Scalable Deep Convolutional Neural Networks for Sparse, Locally Dense Liquid Argon Time Projection\nChamber Data</a> <em>Physical Review D 102, 012005</em></p>\n<p>L. Dominé, G. Giacalone, C. Lorcé, S. Munier, S. Pekar (2018) <a href="https://journals.aps.org/prd/abstract/10.1103/PhysRevD.98.114032">Gluon density fluctuations in dilute hadrons</a> <em>Physical Review D 98, 114032</em></p>\n<h3>Preprints / in review</h3>\n<p>K. Knuth, P. Ailleris, H. Agrama, E. Ansbro, T. Cai, T. Canuti, M. Cifone, W.B. Cornet, F. Courtade, R. Dolan, L. Dominé, L. Dini, B.\nFriscourt, R. Graves, R. Haines, R. Hoffman, H. Kayal, S. Little, G. Nolan, R. Powell, M. Rodeghier, E. Russo, P. Skafish, E. Strand, M.\nSwords, M. Szydagis, G. Tedesco, J. Tedesco, M. Teodorani, J. Vallée, M. Vaillant, B. Villarroel, W. Watters. (2025) <a href="https://www.arxiv.org/abs/2502.06794">The New Science\nof Unidentified Aerospace-Undersea Phenomena (UAP)</a> <em>Submitted</em></p>\n<p>C. Liu, L. Dominé, K. Chavez, R. Socher (2020) <a href="https://arxiv.org/abs/2009.04087">Central Yup’ik and Machine Translation of Low-Resource Polysynthetic Languages</a>\n<em>arXiV preprint:2009.04087</em></p>\n<p>D. H. Koh, P. Côte de Soux, L. Dominé, F. Drielsma, R. Itay, Q. Lin, K. Terao, K. V. Tsang, T. Usher (for the DeepLearnPhysics Collabora-\ntion) (2020) <a href="https://arxiv.org/abs/2007.03083">Scalable, Proposal-free Instance Segmentation Network for 3D Pixel Clustering and Particle Trajectory Reconstruction\nin Liquid Argon Time Projection Chambers</a> <em>arXiV preprint:2007.03083</em></p>',frontmatter:{title:"Research",date:null,description:null}}},pathContext:{slug:"/research"}}}});
